  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chautauqua NWR
  outlines Refuge accomplishments from May through August of 1943. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. Resource management is outlined; topics include timber removal. The public
  relations section of the report describes recreational uses, Refuge visitors, fishing,
  and violations. N-R forms and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
